import { Graphics } from 'pixi.js';
import Shape from './Shape';

/**
 * Extended Graphics, with shape instance
 * @class
 */
export default class ShapeGraphics<T> extends Graphics {
  /**
   * shape instance
   * @member {Shape}
   */
  shape: Shape<T>;

  constructor(shape: Shape<T>) {
    super();
    this.shape = shape;
  }
}
